import React,{ Component } from 'react';
import Page1 from './'
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
class App extends React.Component
{

  constructor(props)
  {
    super(props);
    this.handleSubmit = this.handleSubmit.bind(this)
  }
  handleSubmit(event){
    <Router>
          <Routes>
            <Route path='/admin/adpage1' element={<Page1/>} />
          </Routes>
    </Router>
    event.preventDefault()
  }
  render(){
    return(
      <div className="App">
      <header className="App-header">
        <form onSubmit={this.handleSubmit}>

        <button className='Adbutton'>Admin</button>
        </form>

        <button className='Empbutton'>Employee</button>
      </header>
    </div>
    )

  }
}


export default App;
